import React from 'react';
import {createStackNavigator} from '@react-navigation/stack';

import {Gallery, Maps, Home, About, Objects, History} from '../screens'
import {useScreenOptions, useTranslation} from '../hooks';
import Description from '../screens/Description';
import ARmap from '../screens/ARmap';


const Stack = createStackNavigator();

export default () => {
  const {t} = useTranslation();
  const screenOptions = useScreenOptions();

  return (
    <Stack.Navigator screenOptions={screenOptions.stack}>
      <Stack.Screen
        name="Home"
        component={Home}

      />
      <Stack.Screen
        name="Maps"
        component={Maps}
        options={{title: t('navigation.maps')}}
      />
      <Stack.Screen
        name="AR Gallery"
        component={Gallery}
        options={{title: t('navigation.gallery')}}
      />

      <Stack.Screen
        name="History"
        component={History}
        options={{title: t('navigation.history')}}
      />
      <Stack.Screen
        name="Objects"
        component={Objects}
        options={{title: t('navigation.objects')}}
      />

      <Stack.Screen
        name="ARmap"
        component={ARmap}
        options={screenOptions.back}
      />
      <Stack.Screen
        name="About"
        component={About}
        options={{title: t('navigation.about')}}
      />

      <Stack.Screen
        name="Description"
        component={Description}
        options={screenOptions.back}
      />
    </Stack.Navigator>
  );
};
